import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
    return (
        <>
            <NavLink to='/'> About </NavLink>
            <NavLink to='/contact'> Contact </NavLink>
            <NavLink to='/user'> User </NavLink>
            <NavLink to='/serach'> Serach </NavLink>
        </>
    )
}

export default Navbar;
